import Timer from "./timer.js" 
import ReactAudioPlayer from 'react-audio-player';

function App() {

  return (
    <div>
      {/* <ReactAudioPlayer src="./sound/dbz.ogg" crossorigin="anonymous" autoPlay="true" controls="true" /> */}
      <Layout />

      <Game/>
      <Timer/>
      <div className="container-fluid" >
