          <div className="col-5 text-center">
            <Player1 />
          </div>
          <div className="col-2 align-self-center">
            <Start />
          </div>
          <div className="col-5 text-center">
            <Player2 />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
